import React from 'react';
import "../../assets/css/home.css"

import HomeBackground from "../../assets/img/background_3.jpg";

export default class Home extends React.Component {
    render() {
        return (
            <img style={backgroundStyle} src={HomeBackground} alt="home background"></img>
        )
    }
}

const backgroundStyle = {
    position: 'relative',
    width: 500,
    height: auto,
    zIndex: -1
}
